def descompactagzip(texto):
    """
    :paramn stringZipada: String

    :return : Etree
    """
    arq = BytesIO()
    arq.write(base64.b64decode(texto))
    arq.seek(0)
    zip = gzip.GzipFile(fileobj=arq)
    texto = zip.read()
    arq.close()
    zip.close()
    descompactado = texto.decode("utf-8")
    return etree.fromstring(descompactado), descompactado


