def descompacta_dados_listagem_nota():
    resposta = etree.fromstring(xml.encode("utf8"))
    ns = {"ns": NAMESPACE_NFE}

    zip_resposta = resposta.xpath(
        "//ns:retDistDFeInt/ns:loteDistDFeInt/ns:docZip", namespaces=ns
    )
    # <?xml version="1.0" encoding="utf-8"?><soap:Envelope xmlns:soap="http://www.w3.org/2003/05/soap-envelope" xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance" xmlns:xsd="http://www.w3.org/2001/XMLSchema"><soap:Body><nfeDistDFeInteresseResponse xmlns="http://www.portalfiscal.inf.br/nfe/wsdl/NFeDistribuicaoDFe"><nfeDistDFeInteresseResult><retDistDFeInt xmlns:xsd="http://www.w3.org/2001/XMLSchema" xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance" versao="1.01" xmlns="http://www.portalfiscal.inf.br/nfe"><tpAmb>1</tpAmb><verAplic>1.6.2</verAplic><cStat>656</cStat><xMotivo>Rejeicao: Consumo Indevido (Deve ser utilizado o ultNSU nas solicitacoes subsequentes. Tente apos 1 hora)</xMotivo><dhResp>2023-11-25T17:27:32-03:00</dhResp><ultNSU>000000000003704</ultNSU><maxNSU>000000000000000</maxNSU></retDistDFeInt></nfeDistDFeInteresseResult></nfeDistDFeInteresseResponse></soap:Body></soap:Envelope>'
    notasfiscais = []
    for nf in zip_resposta:
        root, xml = descompactagzip(nf.text.encode("utf8"))
        dic = {}
        for child in root:
            dic[
                child.tag.replace("{http://www.portalfiscal.inf.br/nfe}", "")
            ] = child.text
        if "xNome" in dic:
            notasfiscais.append(dic)
        # documentacao de usar lxml e https://lxml.de/tutorial.html
    return notasfiscais


